const Expertise = () => {
    return (
      <section id="service" className="expertise">
        <h3>Provide Wide Range of Digital Services</h3>
        <div className="service">
          <div>Web Design</div>
          <div>Web Development</div>
          <div>Debugging</div>
        </div>
      </section>
    );
  };
  export default Expertise;
